import { CCol, CRow } from "@coreui/react";
import { FormInput } from "src/Components/UI/Input/FormInput";
import FormSelect from "src/Components/UI/Input/FormSelect";

const FilterOrder = (props) => {
  return (
    <CRow>
      <CCol sm={12} md={3}>
        <FormSelect
          label={false}
          options={["Paid", "Packed", "Delivered"]}
        />
      </CCol>
      <CCol sm={12} md={3}>
        <FormSelect
          label={false}
          options={["Processing", "Packed", "Delivered"]}
        />
      </CCol>
      <CCol sm={12} md={3}>
        <FormSelect
          label={false}
          options={["Processing", "Packed", "Delivered"]}
        />
      </CCol>
      <CCol sm={12} md={3}>
        <FormInput label={false} label="Search Order ID" />
      </CCol>
    </CRow>
  );
};
export default FilterOrder;
